    setOldUserState(oldUserData);
    console.log(oldUserData);
  }, []);
  const[name,setName]=useState(oldUserDatatState.name);
  const[email,setEmail]=useState(oldUserDatatState.email);
  const editedUser = () => {
    console.log("/////////////////");
  };

  if (oldUserDatatState) {
    return (
      <div>
        <Textfield
          id={"name"}
          label={"Name"}
          type={"text"}
          value={name}
          onChange={(e) => {
            oldUserDatatState.name(e.target.value);
          }}
        />{" "}
        <br />
        <Textfield
          id={"email"}
          label={"Email"}
          type={"text"}
          value={email}
          onChange={(e) => {
            oldUserDatatState.email(e.target.value);
          }}
        />{" "}
        <br />
        <Button label={"Update"} onClick={editedUser} /> <br />
      </div>
    );
  } else {
    return <div>Loading......</div>;
  }
}
export default Update;
